deck_description:
This is a deck that providing it gets the right banlist and the meta is ED reliant, can thrive. You can still manage backrow decks with the likes of Denko but your G1 is severely hindered by them so if you wanted to play it in a backrow heavy environment, Denko should be considered in the main over something like Chalice or Droplet. List is definitely cuttable to a straight 40 if you wanted to go this route as you could replace one of the monster negates in the main with Harpie's Feather Duster instead for example. If you wish to play the list in the current format, just cut White Exalted of Dogmatika and Dogmatikabre and the deck will function almost the same but with slightly less power. Nadir Servant being able to send Herald Of The Arc Light to search either of the Dogamtika Rituals and then benefit the Nekroz monsters with the search from Herald Of The Arc Light is really nice as well as Dogmatikalamity being able to send Herald Of The Arc Light in order to summon White Exalted of Dogmatika in the same way that Nekroz Kaleidoscope is another feature that is nice to have whilst also boosting the attack of something such as Nekroz of Unicore in order to make it more difficult to attack over in the process.

&nbsp;

Unfortunately, the deck does lose really hard to Droll &amp; Lock Bird but thankfully with the decline in popularity of Drytron in the current meta, Droll &amp; Lock Bird is being switched out for some other handtraps outside of combo decks that can use it and then proceed to put big bodies on the board and attempt to OTK you. I would do a combos section but your main thing is that you play whichever engine you draw while trying to get yourself to the other half of deck in the process through the use of Nadir Servant, Dogmatikalamity and Nekroz Kaleidoscope. Any other questions please feel free to ask. I do by no means think that this deck will be Tier 1, but it will certainly be able to deal with them in a Rouge capacity.

I made this deck to annoy someone I know personally...anyways, the goal of this deck is to have tokens on the field at all times with the purpose of triggering the effect of Collector or using any of the spells/traps to either increase your life points or decrease your opponent's. However, a deck based just on that would be absolutely unplayable in my opinion, so I added a Cyberse engine in the deck to give it a chance and not have to rely on Gustav's attack power.

&nbsp;

Note: There should be 2 Cynet Crosswipes putting this deck at 43 cards

One of the best and most competitive meta decks in 2021, made in my way of dueling! I'm still not very best in Yu-Gi-Oh, but I'm trying to improve. I love play ultra-meta decks like this, and I'm learning how to make the strong, easy to play deck! In my version of this deck, we have all the Drytron architype cards, but also some old-school, but very strong and competitive cards, like Monster Reborn an Quaking Mirror Force. In the side deck, we have one of my favorite hand traps, Effect Veiler, and one more all-time old-school trap, Spellbinding Circle.

&nbsp;

Note: This IS meta deck (I hope), but I had to mark it as non-meta because of  YGOPRO deck rules. ;-)
